      "content": "com.ubercab.driver\ncom.ubercab.carbon.core.CarbonActivity\nc329ae856791032b5eb34a9b37a1111d\ncom.ubercab.driver:id/active_drawer,com.ubercab.driver:id/end_custom_view,com.ubercab.driver:id/toolbar,com.ubercab.driver:id/help_workflow_primary_button_base,com.ubercab.driver:id/help_workflow_selectable_list_input_label,com.ubercab.driver:id/title_text,com.ubercab.driver:id/rxmap,com.ubercab.driver:id/background_container,com.ubercab.driver:id/mobilestudio_content_container,com.ubercab.driver:id/action_bar_root,com.ubercab.driver:id/annotations,android:id/statusBarBackground,android:id/content,com.ubercab.driver:id/active_container,com.ubercab.driver:id/mobilestudio_content_overlay_container,com.ubercab.driver:id/help_workflow_page_container,com.ubercab.driver:id/help_workflow_component_container,android:id/navigationBarBackground,com.ubercab.driver:id/gone_start_margin,com.ubercab.driver:id/appbar,com.ubercab.driver:id/help_workflow_selectable_list_input_item_container,com.ubercab.driver:id/map\nPlease acknowledge our COVID-19 precautions.,Please confirm you agree to take these precautions by checking the box below.  Note that these policies may be updated again in the future. ,If you don\u2019t take the above precautions, are exhibiting symptoms, or fail to take required precautions (like masking and social distancing) you may lose access to Uber\u2019s Greenlight Hubs, as well as any appointments.,AGREEMENT #1\n\nWhen at or entering Uber\u2019s Greenlight Hubs, you:\n\n- Must wear a mask or other face covering.\n- Must follow local physical distancing guidelines. In most places, that means staying 6 feet or 2 meters from other individuals.\n- May have a temperature check performed, if required by law or considered necessary by Uber.\n- Should practice good personal hygiene, including but not limited to washing your hands and/or using hand sanitizer.,I agree to these precautions to help prevent the spread of COVID-19 at Uber\u2019s Greenlight Hubs.,NEXT,To help prevent the spread of COVID-19, Uber requires that everyone entering Uber\u2019s Greenlight Hubs take the following precautions.,AGREEMENT #2\n\nYou MAY NOT visit Uber\u2019s Greenlight Hubs if:\n\n- Within the last 14 days you\u2019ve recently been diagnosed with COVID-19. \n- Within the last 14 days, you were in close contact with someone who has COVID-19.\n- You have any symptoms of COVID-19.\n\nIf you\u2019ve recently been diagnosed with COVID-19 you may not visit Uber's Greenlight Hubs until you\u2019re fully recovered. This must be at least 14 days after diagnosis.,AGREEMENT #3\n\nIf you become symptomatic or are diagnosed before your scheduled appointment time, you MAY NOT come to Uber\u2019s Greenlight Hubs.\n\nPlease cancel and reschedule your appointment in the Help section of the Driver app. You can contact us for help 24/7 in the app or at help.uber.com.,Help"
