      "content": "com.ubercab.driver\ncom.ubercab.carbon.core.CarbonActivity\ndd25fea192eedd78cd11badccf9f8266\ncom.ubercab.driver:id/webview_root_layout,background,com.ubercab.driver:id/active_drawer,privacy,main,root,com.ubercab.driver:id/rxmap,com.ubercab.driver:id/webview_frame,location-banner-button,com.ubercab.driver:id/background_container,com.ubercab.driver:id/mobilestudio_content_container,com.ubercab.driver:id/action_bar_root,com.ubercab.driver:id/annotations,com.ubercab.driver:id/browser,android:id/content,android:id/statusBarBackground,insurance,com.ubercab.driver:id/active_container,emergency,com.ubercab.driver:id/mobilestudio_content_overlay_container,android:id/navigationBarBackground,animation-wrapper,support,ZN_d0BFDqLQG9ciloh,com.ubercab.driver:id/swipe_refresh,com.ubercab.driver:id/map\nfacebook,Skip to main content,Ride,There\u2019s emergency help if you need it,Sign up to ride, drive, and get delivery,How driver screening works,Google Data Policy,Eat,We know the pandemic has been difficult. But you\u2019ve continued to go the extra mile to help protect our communities\u2014whether it\u2019s wearing a mask, making space for one another, or giving drivers the respect they deserve. Thank you for\u00a0that.,Safety,Riders and drivers are not required to wear masks when using\u00a0Uber.*,Road safety,However, the CDC still recommends wearing a mask if you have certain personal risk factors and/or high transmission levels in your\u00a0area.,AI,Careers,Log in to rider, driver, and delivery sites,Learn more about insurance,To learn more, go here,There\u2019s auto insurance to help protect you,How to reach us,instagram,twitter,, this information is automatically provided to the\u00a0authorities.,Our Community Guidelines,Uber for Business,Drive,Leading auto insurance providers help protect riders and drivers on the Uber app. Uber maintains commercial auto insurance in case of a covered accident, including at least $1 million in liability insurance on behalf of drivers and delivery people once a ride is\u00a0accepted.,We want you to move freely, make the most of your time, and be connected to the people and places that matter most to\u00a0you.,linkedin,Uber Freight,Travel,Privacy,Uber support is available 24 hours a day, 7 days a week, and is handled by a team of trained safety agents. If you\u2019re in immediate danger, you should always contact authorities\u00a0first.,Screenshots may differ from your in-app experience. The material provided on this web page is intended for informational purposes only and may not be applicable in your country, region, or city. It is subject to change and may be updated without\u00a0notice.,We\u2019ve built technology to look out for you,Visit Help Center,Company,Global citizenship,All drivers are background checked before their first trip,Masks are no longer required,Airports,You have our support, whenever you need it,Do not sell my info (California),Thank you for helping take care of one another,Our commitment to safety,More about safety at Uber,Terms,Before anyone can drive with Uber, they must undergo a multi-step safety screen, including being checked for driving violations, impaired driving, violent crime, and other checks. In addition, Uber rescreens drivers every year\u00b9 and uses technology to look for issues in\u00a0between.,Driver safety,Remember: many people still feel safer wearing a mask because of personal or family health situations, so please be respectful of their preferences. And if you ever feel uncomfortable, you can always cancel the\u00a0trip.,Updating our no-front-seat policy,See how it works,Riders are no longer required to sit in the back seat. However, to give drivers space, we ask that riders only use the front seat if it\u2019s required because of the size of their\u00a0group.,Rider safety,Women\u2019s safety,Deliver,Uber,a growing number of US cities,Diversity and Inclusion,Cities,youtube,Our offerings,Click to view more menu options,That\u2019s why we\u2019re committed to safety\u2014from the creation of new standards to the development of technology with the aim of reducing\u00a0incidents.,We hope every trip is a smooth one, but things don't always go as planned\u2014which is why we built RideCheck. By using sensors and GPS data, RideCheck can help detect if a trip goes unusually off-course or if a possible crash has occurred. If the app alerts us to anything out of the ordinary, we\u2019ll reach out to provide you with the resources you need to get\u00a0help.,Courier Safety,Accessibility,Investors,It\u2019s still important to take safety precautions while riding, driving, and delivering. So make sure to roll down the windows for extra airflow, sanitize your hands before and after trips or deliveries, and always cover your cough or\u00a0sneeze.,In an emergency, speed and accuracy are critical. If you call 911 from the Uber app, the app displays your live location and trip details, so you can share them with the emergency dispatcher. And in ,Blog,Gift cards,\u00a9 2022\u00a0Uber Technologies Inc.,Your personal details stay private,About us,Seeing information for this city: San Francisco Bay Area,Newsroom,Current language: English,We use technology to help keep your phone number private, so neither drivers nor riders will see each other\u2019s numbers when communicating through the Uber app. Once a trip is completed, the app also protects rider information by concealing specific pickup and dropoff addresses in a driver\u2019s trip\u00a0history.,Products,Learn more about RideCheck,*Masks may still be required by law in some areas. Please check your local requirements regarding COVID-19 safety protocols. Everyone using the Uber platform is required to comply with applicable laws and regulations while doing\u00a0so.,Safety | Uber"
